import React from "react";
import Button from "./Button";
import { useSelector } from "react-redux";
const LoginPage = () => {
  const container = {
    display: "flex",
    alignItems: "center",
    justifyContent: "space-between",
  };
  const x = useSelector((item) => {
    return item;
  });
  return (
    <>
      <div style={container}>
        <h1>This is Login page </h1>
        <Button />
      </div>
    </>
  );
};
export default LoginPage;
